-- create DB
DROP DATABASE IF EXISTS lab4;
CREATE DATABASE lab4;

USE lab4;

-- create Table
DROP TABLE IF EXISTS Movie_Name;
CREATE TABLE Movie_Name (
  id        INTEGER PRIMARY KEY,
  title     VARCHAR(200) NOT NULL,
  director  VARCHAR(100) NOT NULL,
  movieType VARCHAR(50) NOT NULL,
  tailer    VARCHAR(200) NOT NULL
);

-- insert



-- create
DROP TABLE IF EXISTS Movie_Type;
CREATE TABLE Movie_Type (
  movieType  Varchar(50) PRIMARY KEY,
  Detail     Varchar(200) NOT NULL
);

-- insert

--CREATE VIEW TABLE
CREATE OR REPLACE VIEW lab4.View_Movie AS 
SELECT
`a`.`title` AS `Title`,
`a`.`director` AS `Director`,
`b`.`Detail` AS `Type`,
`a`.`tailer` AS `Tailer` 
FROM `Movie_Name` `a` 
JOIN `Movie_Type` `b` 
ON `a`.`movieType` = `b`.`movieType`
